THE ALEX JONES SHOW
2009.04.13 Monday

Alex talks with Naomi Wolf, author of The End of America: A Letter of Warning to a Young Patriot, and Joe Banister, a former Special Agent of the Criminal Investigation Division of the IRS who resigned after challenging the conduct of the IRS concerning legal issues with taxation. Alex also covers the DHS document on &quot;rightwing terrorists&quot; and other news of the day and takes your calls. 

HR 1: News,DHS predicts violence - gun owners terrorists, commentary, open lines
HR 2: News,tea parties being coopted, open lines
HR 3: News, Naomi Wolf, news, open lines (tax related, etc.)
HR 4: Open lines, Joe Banister as seen on America: Freedom to Fascism, open lines



